INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10205','632','143','1560','2/20/13 12:00:00 AM','6.5','Email','student email: Hi Molly,  I have completed my service hours at Art of Life - finishing with 26.5 hours. My responsibilities have largely remained the same. The only change has been, instead of working with several artists, I was assigned to a specific artist for the day or portion of the day.  Let me know if you need anything else!  Brittany Hudanick         my response: Hi Brittany,  I am glad that you finished your hours!! However, the last time I heard from you I only knew that you had 10 hours as of February 1st. Can you give me the exact days that you did service and for how long you were there? This just helps me to be thorough in my notes and reports!  I will look forward to hearing from you!  Thank you, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10204','632','143','1560','2/20/13 12:00:00 AM','10','Email','email from student: Hi Molly,  I have completed my service hours at Art of Life - finishing with 26.5 hours. My responsibilities have largely remained the same. The only change has been, instead of working with several artists, I was assigned to a specific artist for the day or portion of the day.  Let me know if you need anything else!  Brittany Hudanick          my reponse: Hi Brittany,  I am glad that you finished your hours!! However, the last time I heard from you I only knew that you had 10 hours as of February 1st. Can you give me the exact days that you did service and for how long you were there? This just helps me to be thorough in my notes and reports!  I will look forward to hearing from you!  Thank you, Molly','Winter 2013',null,null,null);
