INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10202','998','190','1711','2/21/13 12:00:00 AM','0','Email','S.S.E. - Samantha,  Below is a one time service opportunity for March 9th. If interested please complete the application and send it to Jordan and his email is below.  Regards,  Sergio Elahi   Rose Petals Workshop  In honor of National Women & Girls HIV/AIDS Awareness Day, CWAP is partnering with The Rose Petals at the University of Chicago to host The Rose Petals Workshop. This will be a day of artistic expression by women and children living with and effected by HIV. We will be providing childcare on the day of the event and are in need of childcare volunteers.      What: Childcare Volunteers  When: Saturday March 9th, choose your shift:  8:30am-1:30pm OR 1:00pm-5:00pm  Where: The University of Chicago School of Social Service Administration  How: Fill out the attached registration form and email it to Jordan at cwapvolunteer@gmail.com.   ','Winter 2013',null,null,null);
