INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9973','1070','180','1550','2/16/13 12:00:00 AM','10','Email','"In regards to my hours, every day I volunteer I am there for 2.5 hours. Currently I am only going in on Thursdays, but I am going to try to get a few more days in since we are half way through the quarter. As of today I have volunteered 13 hours. My very first day I was there for 3 hours, but every Thursday since then I have been there for 2.5 hours. I was placed with the 5th graders again. I think I am going to be with them for the rest of the session. Because I work with Carla they usually address their questions towards her, but they are comfortable with having me help them. However, this passed Thursday they were addressing their questions to me as well which made me feel like they are getting even more comfortable with having me around. And a few of them were starting to share with me interesting events that happened earlier at school. I am really enjoying my time there." ','Winter 2013',null,null,null);
