INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9810','1167','189','1675','2/15/13 12:00:00 AM','0','Email','Hello All,  It''s the end of week six, hopefully this means that you are all done with midterms and onto final projects and such! I cannot believe how quickly the quarter flies by, but with that means only a few more weeks to get your hours in!  So, per usual, I need to know: 1. How many hours you have completed this week 2. How many hours you have in total 3. What you did during those hours  Please email me as soon as possible. Next week is week seven, with week seven we send out reports to your professors, meaning they will be notified if you haven''t communicated with me at all this quarter. A little reminder is that the professor may lower your grade for lack of communication with me.  I will look forward to hearing from you, Molly','Winter 2013',null,null,null);
