INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9749','1150','153','1726','2/14/13 12:00:00 AM','3','Email','Good evening Steve.  This is Alexi Runions.  I am doing my Service Learning at Tutors on Wheels based out of Addison, IL.  My Program Director is Jeanie Jadran (630)217-0396.  I have done an orientation through DePaul (online) and with the program (1.5 hours).  I have also tutored for 3 hours.  I will be tutoring 6 hours a week for the rest of the quarter.  The date I acquired this was on Monday, January 28th.  (I spoke to Sergio and he set me up with the program.)  I had an orientation on Friday, February 1st.  I tutored on Wednesday, February 6th.  I will continue tutoring on Saturday, February, 16th.  Then twice or three times a week for 2-3 hour sessions for the duration of the quarter.  I am teaching ESL to adults.  Each is at a different level, and I have different lesson books to use that caters to their abilities.  I use the practice of repeating scenarios and words/numbers/letters/phrases in English.  We use the workbooks as guides and go at the pace that is comfortable for th','Winter 2013',null,null,null);
