INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9742','1126','184','1453','2/14/13 12:00:00 AM','0','Email','Hello Everyone,  I hope you have all had a good week and midterms are complete. I am emailing you because I need a hours update from you. It is the end of week six and we will be sending out reports to your professor next week. It is very important that you email me with an hours update. I need to know how many hours you will have completed by the end of Friday February 15, 2013.  Again, failing to communicate with me can effect your grade in the class. If there is no communication then we don''t know if you are doing your hours, which means your professor doesn''t know if you are doing your hours.  Finally, the yellow sheets get handed into your professor at the end of the quarter. The organization may ask to make a copy but make sure the actual yellow sheet is handed to your professor.  If you have any questions or concerns please email me as soon as possible.  Thank you,  Victoria Fonseca','Winter 2013',null,null,null);
