INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9700','948','165','1770','2/14/13 12:00:00 AM','0','Email',' Hello Margaret,  I just tried to call you and this must not be a good time to talk.  I have just talked to Jonathan the staff member for Life Directions. As part of the nursing program you have to complete 15 hours of service per quarter until you graduate. Van knows this which is why he was talking long term. Now, you don''t have to continue service at Life Directions for the remainder of your career at DePaul but it would be a lot easier if you could stay with one organization.  That is where the miscommunication is, so again you only have to complete 15 hours. But when Van was talking to you he already knows that the Nursing students have to continue working with a non-profit until they graduate so he was just assuming that you were going to be there until the program is over.  I have CC''d the other two classmates on this email and I have included Jonathan who is the staff member for the class, and Charlotte Phillips who is my direct boss. If you have any other questions or concerns','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9699','948','165','1770','2/14/13 12:00:00 AM','0','Email','Hi Victoria- Van from Life Directions said he never heard from anyone at DePaul. I wanted to touch base on this since I thought we were on the same page after talking on the phone last week. Feel free to give me a call to talk again and clarify any confusion. Thank you- Margaret','Winter 2013',null,null,null);
