INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9679','720','169','1570','2/14/13 12:00:00 AM','0','Email','I''m glad that you''ve had a very rich experience doing service with Chicago Metropolitan.  Will you try to get an internship with them after you complete the rest of your hours today?   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9678','720','169','1570','2/14/13 12:00:00 AM','0','Email','Hi Ken,   Thanks for updating my file. I am truly enjoying my work with the Chicago Metropolitan Battered Women?s Network. Attending the weekly court sessions have been very enriching for me and I would like to continue working with the Network in the future, perhaps in a more active role where I feel I could contribute in some way.   On Thursday, I will hit 25 hours of service learning; it has gone by very quickly.     Thanks, Delilah Johnson','Winter 2013',null,null,null);
