INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9654','1154','145','1680','2/12/13 12:00:00 AM','3','Email','student email:  Hey Molly,  I went in to the Boys & Girls Club yesterday from 3:55 PM - 6:40 PM. I will also be going in tomorrow.  Best,   Billy Moening MY response: Hi Billy,  I am glad that you are able to start completing your service hours, I know that it has been a long wait! I will credit you with 3 hours from Tuesday and if you will shoot me an email letting me know how many hours you do today, I will get that added in as well!  Thanks for keeping me in the loop!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9653','618','180','1565','2/11/13 12:00:00 AM','0','Email','email from classmate (Elizabeth Hakimi), includes student-->Hi Elizabeth,  I am sorry for the delay in response! I am glad that you have been actively completing your service hours!! When you get a chance please double check how many hours exactly you have completed, I need an exact number in order to be able to update your file here.  Keep me updated! I appreciate your help!  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9652','618','180','1567','2/11/13 12:00:00 AM','8','Email','students email-->  Hey Molly, I don''t have the exact amount of hours in front of me but Christina and I have been pretty consistently going on Tuesdays and Thursdays from about 3-5. We assist with homework and orchestrating games and activities to keep the children occupied throughout the program. Hope you had a good weekend, Elizabeth Hakimi My response-->Hi Elizabeth,  I am sorry for the delay in response! I am glad that you have been actively completing your service hours!! When you get a chance please double check how many hours exactly you have completed, I need an exact number in order to be able to update your file here.  Keep me updated! I appreciate your help!  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9651','618','180','1684','2/9/13 12:00:00 AM','2.5','Email','student email -->   Hi,  I just wanted to let you know I have completed my orientation and I am going in to ACP twice a week for 2.5 hours a day.  Thanks, Jeff Greenwood MY response -->Hi Jeff,  I am glad that you were able to take care of your orientation! Have you been going in twice a week, or are you starting that now? I just want to clarify because I need to know how many service hours you have completed so far! Also you can include how long you were at orientation- so just shoot me a quick email and let me know so far how many hours you have done!  I really appreciate it! Thanks Jeff!  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9650','618','180','1564','2/9/13 12:00:00 AM','7.5','Email','email from student-->  Hey Molly,  I''ve done a total of 9 hours of volunteer service,and I''m planning to do approximately 6 hours more next week.I mainly assists youth,help the kids with their homework, playing games with them and such.Hope that helps.Have a great weekend!:) Fiza   MY student--> Hi Fiza,  I am sorry for the delay in response!! I am glad that you are getting your hours taken care of! Were you able to complete the 6 hours you were expecting to get done this week? I will make that in your file if you were!  Please, just continue to keep me updated! You are right on track!!  Thank you, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9649','946','167','1665','2/12/13 12:00:00 AM','0','Email','from student-->I still have 2 service hours. This Wednesday I will be at the Leukemia and Lymphoma Society office from 12-4:30.   -Sarah Gayle Caro MY resposne-->Hi Sarah Gayle,  How did your service go yesterday? I hope everything went smoothly, be sure that you are sending me updates with how your hours are going and what types of things you are doing! I will continue to send out weekly check-ins!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9648','946','167','1667','2/9/13 12:00:00 AM','0','Email','from student --> Hi Molly- no hours this week, but I will be on site this coming wednesday. my response-->Hi Jordan,   That''s okay, just make sure that you are keeping up with your requirements! How did service go yesterday?  Let me know if there anything I can help with, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9647','632','143','1563','2/8/13 12:00:00 AM','6','Email','email from student ---> I completed 845 a.m. to 230 p.m. 5 hours 45 minutes and during that time I have been helping artists complete their pieces and just being an all around positive attitude for all the artists going around and keeping them on task.     Olivia Radziszewski MY response --->Hi Olivia,  I am sorry for the delay in getting back to you! That sounds great, you are well on your way to having all of your hours done!  Let me know if you need anything from me, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9646','632','143','1561','2/9/13 12:00:00 AM','7','Email','Email from student---->  I''ve completed 10 hours so far, but I''m going to increase my weekly hours from 3 to 4, so I''m on track.  At the service site I work one on one with artists, helping them with daily goals. Tom MY response ----> Sorry for the delay in response!! That sounds great, it sounds like you are right where you need to be as far as getting hours taken care of!  As always, if you need anything, let me know!  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9645','1215','167','1724','2/8/13 12:00:00 AM','1','Email','email from student --->  Good afternoon,  i just had my orientation this Thursday and that was an hour long. I am planning on doing 4 hours each week until week 10 and will have them completed by then. I talked to the coordinator of Allied Health and we discussed how I can be actively involved in the curriculum. We concluded that I will be performing demonstrations and practices with basic nursing skills accompanying the subject to be taught each week as well as collaborating with the main teacher to teach students physiology and anatomy.   Joanne Lam','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9644','1126','164','1624','2/13/13 12:00:00 AM','0','Email','Hello Alexa,  I understand that there has been a lot of confusion this quarter about the Virtus Training and who needs to complete it. First, your virtus training will count towards your hours so the 4-5 hours spent there will count.  Second, there were many emails from myself, Charlotte Phillips, & Beatrice about the virtus training and where & when you would be able to complete it. Your professor knows about all of the emails sent by all of us and what has been going on. I am sorry that you were unable to get it done at a earlier time but it was very clear from a numerous people about what had to be done. Even if you were told at orientation one thing, my boss had sent out a email to everyone involved with St. Josephs about the virtus training needing to be completed. It will be unfortunate if you didn''t receive the email, and I apologize if you didn''t get that email.   Third, you were receiving emails from various people because we wanted to make sure that people were getting every ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9643','1126','164','1624','2/13/13 12:00:00 AM','0','Email','Hi Victoria,                   I have Virtus and Mandated Reporter training tomorrow morning. I have not completed any service hours so far. As you can tell, it''s the end of the fifth week and a majority of us have nothing completed. This organization has been quite complicated to work with. Orientation wasn''t until the third week of the quarter, which made completing all of the hours already difficult. At orientation we were told that we could start our hours without Virtus/Mandated training (as long as we did it eventually.) The fourth week was filled with confusing emails about who attended orientation and interviews. At the end of the fourth week, when they finally became more organized, I was told I couldn''t start my hours until I completed the training sessions (not what I was told at orientation)? I was supposed to attend training this week, but I couldn''t miss my night class. Hopefully I can finally start my hours this week.I have already set up a meeting with my professor abou','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9642','1126','184','1455','2/13/13 12:00:00 AM','0','Email','I have completely orientation.    Sent from my iPhone','Winter 2013',null,null,null);
