INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9640','1126','164','1621','2/13/13 12:00:00 AM','0','Email','I will be attending a session this Saturday in St. Francis de Sales on Saturday, February 16. I have already completed the Mandated Reporter training.  Iliana','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9639','1056','189','1765','2/13/13 12:00:00 AM','0','Email','Hello Everyone,  I am emailing you guys because I have it in my records that you have NOT COMPLETED orientation. It is already the end of week six. You need to email me back AS SOON AS POSSIBLE to let me know if you have a) had orientation b)have orientation scheduled c) have not completed orientation d) dropped the course.  If you haven''t completed orientation or don''t plan on by the end of the week it is going to be extremely hard for you guys to finish your hours before the quarter ends.   Please email me as soon as possible.   If you have any questions or concerns feel free to contact me.  Thank you,  Victoria Fonseca','Winter 2013',null,null,null);
