INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9617','1126','164','1624','2/13/13 12:00:00 AM','0','Email','Hi Victoria,                   I have Virtus and Mandated Reporter training tomorrow morning. I have not completed any service hours so far. As you can tell, it''s the end of the fifth week and a majority of us have nothing completed. This organization has been quite complicated to work with. Orientation wasn''t until the third week of the quarter, which made completing all of the hours already difficult. At orientation we were told that we could start our hours without Virtus/Mandated training (as long as we did it eventually.) The fourth week was filled with confusing emails about who attended orientation and interviews. At the end of the fourth week, when they finally became more organized, I was told I couldn''t start my hours until I completed the training sessions (not what I was told at orientation)? I was supposed to attend training this week, but I couldn''t miss my night class. Hopefully I can finally start my hours this week.I have already set up a meeting with my professor abou','Winter 2013',null,null,null);
