INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9594','1212','150','1352','2/13/13 12:00:00 AM','5','Email','Hello,  I have been working on a Directory of Oak Park for the Austin Youth Justice Coalition, which is a branch of the New Birth Training Institute. The following are the hours that I have dedicated towards research and compiling data:  2/1/13- 3 hours 2/7/13- 2 hours  I will be submitting the directory by the end of this week, and have new tasks to work on for the Coalition.   Kristin Gorman','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9593','1214','145','1357','2/13/13 12:00:00 AM','0','Email','Hi Hannah,  That looks great, thanks. I hope you''re enjoying your service so far with Greater Englewood CDC. Please send me the same type of update and the end of each week of your service. Thanks!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9592','1214','145','1357','2/13/13 12:00:00 AM','4.5','Email','Hi Caity,  Here is a list of the hours I have completed so far at the Greater Englewood CDC:  1. 2/5: We discussed further in depth about what their goals and plans are. Talked about what exactly they want me to do for and with them. We also talked in great lengths about the history of Englewood and why this organization is so important. 1 hour and 15 minutes 2. 2/10: I did some research and made phone calls to find information about how the CDC can advertise their campaign in different area. 1.5 hours 3. 2/12: We discussed my research thus far, did some more research collectively, and went over what was discussed at a board meeting that the CDC had a few days ago. 1.5 hours  Please let me know if you need any additional information from my progress so far.  Thank you, Hannah Friedlich','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9591','1212','150','1347','2/13/13 12:00:00 AM','0','Email','Leslie,  No problem. Thank you for letting me know. Since your site is different you won''t have to check in with me any further about your hours. Enjoy the rest of your quarter!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9590','1212','150','1347','2/13/13 12:00:00 AM','0','Email','Hello Caity, I spoke with Professor Strain this morning about my service learning. I am currently enrolled in two different service learning classes and am unable to fully commit to both sites. As I have been having issues keeping in touch with New Birth and have only been to the site once, I have decided it is best for me to commit more time to the other site, which is Lighthouse. Professor Strain has given his consent for me to do this, and I am wondering from your end what I need to do.  I apologize for the delay I wanted to have confirmation from my professor before I made a decision. Thank you, Leslie Munson','Winter 2013',null,null,null);
