INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9484','1168','180','1419','2/12/13 12:00:00 AM','3','Email','Dear Steven         My hours for this past week were 3 hours which was on 2/6/2013. Also I do not have internet on my phone, I did not know that the afterschool program was going to be canceled until I arrived at the Vietnamese Association. I live in ohare, I take the blue and red line. When it comes to travel time I much rather you google it and where it says options go to subway and it should tell you how long it takes. My address is 1774 stockton ave des plaines, IL 60018. I do not want to waste your time, but I am the type of person that likes to use evidence to support my statements. The reason is because I do travel good distance and I do not want to sound like I am exaggerating. Anyway my hours without friday''s commute time are at 6.5 hours.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9483','1110','152','1362','2/12/13 12:00:00 AM','6','Email','Sent email with update.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9482','1110','152','1362','2/12/13 12:00:00 AM','6','Email','Hi Steven,  I actually switched where I''ll be doing my service work to the Logan Square Neigborhood Association.  Last Thursday I spent 2 hours at the Erie House learning how to properly assist applicants filling out their citizenship applications and this past Saturday I worked with many LSNA volunteers at Malcolm X College helping non-us citizens with their paperwork during the New Americans Initiative event.  1.  Tom Wolski 2.  6 hours (2 training 4 - Malcolm X Event) 3.  2hr - Thurs 2/7 & 4hr - 2/9 4.  I was trained how to fill out the documents and worked with the applicants to complete the application.  Each application took 45min - 1hr to complete.  Tom Wolski 815-557-3226','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9481','811','153','1359','2/12/13 12:00:00 AM','8','Email','February 2, 2012 2 hours on site - designing app with group 2 hours off site - design documents  February 9, 2012 2 hours on site - designing app with group 2 hours off site - design documents','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9480','1168','143','1314','2/12/13 12:00:00 AM','3','Email','1) Michael Randazzo 2) 3 hours on February 6, 2013. I don''t know if orientation counts for hours but it was 30 min long on Janurary 15, 2013. 3) I watched the kids to make sure they are behaving along with helping the kids with homework','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9479','1040','152','1715','2/12/13 12:00:00 AM','0','Email','Thanks for your quick reply.  I just sent you an e-mail regarding my service learning project.  Per your request, I will send you weekly updates.  So far, my learning experience is great.  I really enjoy helping these people at PAD''s - Safe Haven.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9478','1040','152','1715','2/11/13 12:00:00 AM','6','Email','My name is Heather Hansen.  As of Friday, February 8th, I have completed 6 hourse of volunteer service learning at PAD''S - Safe Haven in North Chicago, IL.    I acquired this volunteer opportunity on Thursday, January 24th.  I had my orientation on Friday, January 25th with Lynn Flynn who is the Volunteer Coordinator at PAD''S.   Safe Haven a reidential program in North Chicago for the homeless mentally ill.  There are approximately 15 people in this program.  I''ve been working with Lynn Flynn and helping her organize, prepare, deliver, and serve hot nutritious meals to these individuals.  So far, this has been a great experience.  I''ve been able to interact with these individuals while making sure they do not go hungry.','Winter 2013',null,null,null);
