INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9465','840','183','1779','2/12/13 12:00:00 AM','8','Email','12-Feb-12 student emailed me and informed me that she completed 8 hours. Her email: Hi Isra, Sorry for the delayed reply. I have not completed orientation, not sure where or when I am supposed to. However, I have been to Hephzibah 4 times now and have completed 8 hours. I go there on Tuesdays and Thursdays, for 2hours if there''s anything else you need to know please let me know!  Thanks,   Melissa.                                                          ','Winter 2013',null,null,null);
