INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9217','1168','180','1574','2/8/13 12:00:00 AM','2.5','Email','Hi, I have done 6 hours so far on 1/25,1/28,and 2/4. I tutored math and reading on those days. On the 4th, we were in charge of the kids and were the only ones left in the building and were in charge of getting the kids out by 6 because no one else was there. It is going to be really hard to get the hours in though because they were closed last Friday, this Friday, Monday, and Tuesday.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9216','930','186','1677','2/8/13 12:00:00 AM','3','Email','Hi Steven,  I attended the orientation last Friday. Here''s the info:  1. Alex Dzik 2. 3 hours (9am-12pm) 3. Friday, February 1, 2013 4. Orientation on housing rights/general information about Latino Policy Forum  Natalie emailed us this past Monday to say that the Mexican Consulate was not hosting any presentations for this week (9/4-9/8). As next week is already week 6, is it still possible to complete the required number of hours for Service Learning?   I am volunteering with Latino Policy Forum because the type of service it does at the Mexican Consulate interests me; I do not require Service Learning to graduate. I was wondering what your opinion is, considering Latino Policy Forum has not enabled us to volunteer at the consulate this far into the quarter.','Winter 2013',null,null,null);
