INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9092','1042','156','1400','2/7/13 12:00:00 AM','3.5','Email','Thanks for the detailed response Scott.  I''ve marked you down for a total of 12 hours and 30 minutes.  It sounds like your doing a great mix of different things at PAA.  Keep it up!  I look forward to hearing from you again.   Take care, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9091','1042','156','1400','2/7/13 12:00:00 AM','9','Email',' Absolutely!  So far I have 12 1/2 hours completed. I did 4 my first weekend, then 8 1/2 last weekend for the PAAWR to Empower launch event.  The first weekend I worked with Malik and Annie on promoting the PAAWR to Empower Facebook page by creating a contest to give away tickets.   Then I also made a press release for the Run/Walk 5k in May.   Last weekend at the event, I helped cut up fruit, then bring over materials, helped Malik pick up the food, served the food, and helped clean up as well.   So far, it''s been a good time! I really enjoy meeting everyone and seeing how I can help PAA accomplish their goals.   Let me know if there''s any other info you need from me. And ill make sure to kept you up to date on my hours as well.   Thanks! ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9090','720','150','1382','2/7/13 12:00:00 AM','0','Email','Thanks for the very detailed response.  I''ve marked you down for a total of 13 hours and 30 minutes.  I''m glad that everyone at the court is very considerate and patient in regards to the entire court process.  I look forward to your next update!   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9089','720','150','1382','2/7/13 12:00:00 AM','6','Email','The experience has been pretty good. My first day on January 31st went really smoothly. Thanks to the courthouse tour I knew the security standards, where to go to get my observation forms, what to expect from the court rooms, etc. While in my designated court room the deputies were attentive to me and were kind enough to print out a call sheet for me without me even having to ask for one. During the judge''s breaks they would occasionally check up on me and make sure I knew what was going on and ask if I had any questions. The only thing I wasn''t too sure on was how long I should be there. My court call began at 9:00am and I stayed there until around 3:00 but I think this occurred because I mistook the ending of the court call for a recess. Around 11:00am we were all asked to move outside and then within minutes I was asked back in and a bench trial for one of the previous cases commenced. So I stayed throughout the rest of that case because I wasn''t sure if this was still considered p','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9088','720','169','1569','2/5/13 12:00:00 AM','0','Email','The experience has been pretty good. My first day on January 31st went really smoothly. Thanks to the courthouse tour I knew the security standards, where to go to get my observation forms, what to expect from the court rooms, etc. While in my designated court room the deputies were attentive to me and were kind enough to print out a call sheet for me without me even having to ask for one. During the judge''s breaks they would occasionally check up on me and make sure I knew what was going on and ask if I had any questions. The only thing I wasn''t too sure on was how long I should be there. My court call began at 9:00am and I stayed there until around 3:00 but I think this occurred because I mistook the ending of the court call for a recess. Around 11:00am we were all asked to move outside and then within minutes I was asked back in and a bench trial for one of the previous cases commenced. So I stayed throughout the rest of that case because I wasn''t sure if this was still considered p','Winter 2013',null,null,null);
