INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('9054','1167','165','1742','2/7/13 12:00:00 AM','0','Email','Hi Ladies,  Joyce suggested I email all of you together rather than separately so that you are all on the same page. I have called Ricardo (the site representative for your class) this morning to try and set up some times for you all to come in! Unfortunately he is out of the office most of the day, so I left a message and hopefully I will hear from him! If not I will try again first thing in the morning! I am sorry for all of this delay! I am in the office Tuesday, Thursday, Friday; so hopefully we can get this settled in the next couple of days so that you can go in next week!  I appreciate your patience!! As soon as I know more you will know more!  Thank you, Molly','Winter 2013',null,null,null);
