INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8882','1168','180','1418','2/4/13 12:00:00 AM','0','Email','Sent email: I''m emailing you to let you know that I tried going to my service learning site this past Friday from 3-6pm. When I arrived at the site the man at the front desk informed me that the rep of our site (Vietnamese Association) was out sick, and therefore, I was unable to complete any hours. I still have zero hours and am getting a little worried about completing all of my hours on time. The only day I can attend the service learning site is Friday (3-6pm). I just wanted to update you and tell you my concerns. I look forward to hearing back from you at your earliest convenience.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8881','1154','163','1420','2/5/13 12:00:00 AM','0','Email','Sent email: I was informed that your were missing your background check from Union League Boys and Girls Club. Please let me know if you have contacted them of set up a orientation yet.  ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8880','1154','163','1421','2/5/13 12:00:00 AM','0','Email','Sent email: I wanted to know if it was possible to switch my site from Boys and Girls Club to Centro Romero because it is much closer. I do not get out of class until 4:10pm everyday and I do not feel very comfortable commuting all the way to the Boys and Girls club. I also have not been able to get in contact with them, so I would like to switch my site over to Centro Romero. I hope to hear back from you soon, thank you!','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8879','930','186','1679','2/4/13 12:00:00 AM','0','Email','This is Karina, I believe we spoke last week. I wanted to get back to you regarding the orientation. When Natalie came to our classroom to speak about a volunteer opportunity with her I thought it would be a great experience. I then spoked with her and decided that the best time for everyone participating at the site would be Wednesday mornings.    However, she later got back to us letting us know that the best day to have our orientation was a Friday. I then emailed her back mentioning that Fridays was usually really hard for me. She mentioned that it was the best day she could do. So, I decided to do my best in attending the orientation on the Friday she had assigned. I had planned and was ready to go, but last minute something came up and couldn''t make it. I heard that another volunteer emailed her about not being able to attend the orientation either.    This is our fifth week into the quarter and haven''t gotten started. There are weekly assignments that need to be getting done eit','Winter 2013',null,null,null);
