INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8862','1044','178','1594','2/5/13 12:00:00 AM','0','Email','Hello,  I know that this has been kind of a complicated process, but I wanted to introduce myself! My name is Molly McVay and I will be your Service Learning Coordinator this quarter for Passages Family Services in PSC 282-201. I am currently a sophomore, majoring in Sociology and American Studies with a concentration in Racial and Ethnic Interaction. This is my first year here at the Steans Center. My job this quarter is to make sure that I can answer all questions and concerns you have for your service site.  There are a couple things that I would like to double check.   1. Would you please reply to this email so I know that I have the appropriate email address. I will be sending out weekly emails to check and make sure you are doing your hours and that there are no problems with the organization.   2. Would you also send me an appropriate telephone number? If there is no communication via email than I will call weekly to make sure that you are still involved with the organization an','Winter 2013',null,null,null);
