INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8644','1126','184','1490','2/1/13 12:00:00 AM','4','Email',' hi victoria my name is angela cornejo and im volunteering in st.josephs. i have started my volunteer work last thursday. i will be working with the adult computer classes and will not have to take the virtus training however i did complete the mandate reporter training. i will work every tuesday from 5:30- 7:45pm and will alternate with another volunteer on thursdays to complete our hours. i believe i have completed 4 hours so far.','Winter 2013',null,null,null);
