INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8640','1126','164','1626','2/1/13 12:00:00 AM','0','Email',' Hello Victoria Fonseca   My name is Madison Jones, I will be attended the  Virtus Training  on February 5, 2013. Sorry it has taken me so long to sign up for a training.  Madison Jones','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8639','946','167','1667','2/1/13 12:00:00 AM','0','Email','Hi Jordan,   That''s okay, no worries! I am glad that you were able to meet and get your orientation taken care of! How long did that take? It counts towards your service hours, so I will go ahead and record it! I will be checking in once a week, just to see how things are going, so even if you don''t have anything to update me with don''t worry! I just want to keep the communication waves open!   Please let me know if there is anything that I can help with!  All the best, Molly ________________________________________ From: Jordan Keller Sent: Thursday, January 31, 2013 2:29 PM To: McVay, Molly Ellen Subject: Re: Weekly Check-in Leukemia & Lymphoma Society (NSG 431-203)  Hey Molly - Sorry I didn''t get back to you earlier. It''s been a pretty busy week. My name is Jordan Keller, and I''m one of the nursing students working with LLS. We had our first meeting with Jennifer last week and went over the mission and what they have in mind for us, but we won''t be getting on site until the 13th. I ','Winter 2013',null,null,null);
