INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8637','1126','180','1480','2/1/13 12:00:00 AM','0','Email',' Victoria,   My name is Stephanie Diaz, I will be completing and individual orientation with Beatrice Jurado Friday morning (February 1st) and I will be attending the Virtus training on February 5th.   Contacted them right away about setting up orientation but they only emailed me one date. It was scheduled for January 21st and I emailed back saying I could not make it and if there were other days I could attend. I emailed them twice asking but never received response. Last week I spoke with supervisor Iris and Beatrice again and I will finally be attending orientation Friday morning.  Couldn''t do Monday Jan 21st or any other day Monday with through Thursday due to morning classes.   Also, I have a question, during the summer I volunteered at Mount Sinai Hospital, could those hours count towards this requirement?  I volunteered about three hours once a week for a month in August.    Thank You, Stephanie Diaz ','Winter 2013',null,null,null);
