INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8556','946','167','1667','1/31/13 12:00:00 AM','0','Email','Hey Molly - Sorry I didn''t get back to you earlier. It''s been a pretty busy week. My name is Jordan Keller, and I''m one of the nursing students working with LLS. We had our first meeting with Jennifer last week and went over the mission and what they have in mind for us, but we won''t be getting on site until the 13th. I don''t think they took the quarter system into account and thought we were on semesters, so the timeline is a bit off. But I will be in touch after that first day on site, Of course, I''m available to talk any time leading up to that if you have any other questions/concerns.  Jordan Keller','Winter 2013',null,null,null);
